pragma solidity ^0.5.12;

contract Ajwa {
    string  public TokenName = "Ajwa Token";
    string  public TokenSymbol = "AJ";
    string  public TokenStandard = "Ajwa Token v1.0";
    uint256 public TotalSupply;
    address payable public owner;
    uint256 public TokenPrice;
    uint256 public TokensSold;
    bool buy=false;

    event Sell(
        address _buyer, 
        uint256 _amount
        );

    event Transfer(
        address indexed _from,
        address indexed _to,
        uint256 _value
    );

    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );

    mapping(address => uint256) public balance;
    mapping(address => mapping(address => uint256)) public allowed;

    constructor (uint256 _initialSupply,uint _tokenPrice) public {
        owner=msg.sender;
        balance[msg.sender] = _initialSupply;
        TotalSupply = _initialSupply;
        TokenPrice=_tokenPrice;
    }

    function transfer(address _to, uint256 _value) public payable returns (bool success) {
        require(_to!=msg.sender);
        require(_value>0);
        require(balance[msg.sender] >= _value);
        balance[msg.sender] -= _value;
        balance[_to] += _value;

        emit Transfer(msg.sender, _to, _value);
            return true;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        require(_value>0);
        allowed[msg.sender][_spender] = _value;


        emit Approval(msg.sender, _spender, _value);

        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public payable returns (bool success) {
        require(balance[_from]>=_value);
        require(_value>0);
        require(allowed[_from][msg.sender]>=_value);
        balance[_from] -= _value;
        balance[_to] += _value;
        emit Transfer(_from, _to, _value);
        return true;
    }
    
    function multiply(uint x, uint y) internal pure returns (uint z) {
        require(y == 0 || (z = x * y) / y == x);
    }
    
    function buyTokens(uint256 _numberOfTokens) public payable returns(bool success){
        require(_numberOfTokens>0);
        require(msg.value == multiply(_numberOfTokens, TokenPrice));
       require(msg.sender!=owner);
        require(balance[owner] >= _numberOfTokens);
        balance[owner]-=_numberOfTokens;
        balance[msg.sender]+=_numberOfTokens;
        TokensSold += _numberOfTokens;
        owner.transfer(msg.value);
        emit Sell(msg.sender, _numberOfTokens);
        return true;
    }
    // function balanceofowner()view public returns(uint){
    //     return owner.balance;
    // }
    modifier onlyOnwner(){
        require(msg.sender==owner);
        _;
    }
function kill() public onlyOnwner{
    selfdestruct(owner);
}
}
